import { REQUEST_POST, POST_SUCCESS, POST_FAILURE, CREATE_POST , EDIT_POST , DELETE_POST } from './types'

const initialState = []

export default (state = initialState, action)=>{
        switch (action.type) {
            case REQUEST_POST:
                return {}
                break;

            default:
                break;
        }

}
